import React, { Component } from "react";

class Footer extends Component {
  render() {
    return (
      <footer>
        <h2><span class="underline"><span>LEEMINJE</span></span></h2><br/>
        <h3><span class="underline"><span>github.com/OlMinJe</span></span></h3>
        <h3><span class="underline"><span>React와 Node.js를 이용하여 CURD 구현하기</span></span></h3>
      </footer>
    )        
  }
}

export default Footer
